  <header className={styles.Header}>
    <AuthMenu />
    <h1>Timmy's Shoes</h1>
    <div className={styles.Header__search}>
    <button className={styles.Header__search__btn}>search</button>
    <input type="search" />
    </div>
  </header>
);

export default Header;
